import React, { Component } from "react";
import "./index.css";
import { Link } from "react-router-dom";
import { Image, Container } from "react-bootstrap";

const MoviePoster = ({ name, id, poster }) => {
  return (
    <Link to={`/titles/${id}`}>
      <Image src={poster}></Image>
    </Link>
  );
};

export default MoviePoster;
